import React, { Component } from 'react'
import { View, Text, StyleSheet } from 'react-native'


const homeView = () => {
  return (
    <View style={styles.main}>
      <Text style={styles.test}>This is home Page</Text>
    </View>
  )
}

const styles = StyleSheet.create({
  main: {
    flex: 1,
    justifyContent: 'flex-start',
    alignItems: 'center',
    width: '100%',
    alignSelf: 'center',
    paddingRight: 10,
    paddingLeft: 10

  },
  test: {
    textAlign: 'center',
    fontWeight: 'bold',
    fontSize: 1000,
    color: 'black',
  }
})

export default homeView

